import React from 'react';
class Nav  extends React.Component {

    render() { 
        return ( 
            <nav className="menu">
{/* <div className="nav-title">
<h3>BakeMore</h3>
</div> */}
<div className="menu-container">

<ul className="Menu-list" >

    <li className="meni-item"><a href="">Home</a></li>
    <li className="meni-item"><a className="menu-link" href="">Gallery</a></li>
    <li className="meni-item"><a className="menu-link" href="">Order Online</a></li>
    <li className="meni-item"><a className="menu-link" href="">About</a></li>
    <li className="meni-item"><a className="menu-link" href="">Contact</a></li>
    
</ul>
</div>



            </nav>
            
         );
    }
}
 
export default Nav ;
